[CumFortune] Nataly Von (ep335) 

When she came again for some days we started to do some pictures where she wanted to try out her resently bought fishnet outfit. After the shooting I showed her the pix on my camera. My plan was to tape her looking at the pix as a kind of backstage clip and then have another coffee before the shooting, but she went to the bed straight and convinced me to start the action in the moment.

